import { useState, useEffect } from "react";
import ShowAllRecipes from "../sections/ShowAllRecipes";
import { getData, getUserRecipes } from "../DAL/api";




function Profile() {
    const [userRecipes, setUserRecipes] = useState([])
    const [images, setImages] = useState([])
    useEffect(async () => {
        const fetchRecipes = await getUserRecipes()
        setUserRecipes(fetchRecipes)
        const fetchImages = await getData('images')
        setImages(fetchImages)
    }, [])


    return (
        <ShowAllRecipes recipes={userRecipes} images={images} />
    )
}
export default Profile
